import React, { useState } from "react";
import { motion } from "framer-motion";
import "../styles/DiceRoll.css";

const DiceRoll = () => {
    return (
        <div className="example">
            <div>1</div>
            <div>2</div>
            <div>3</div>
        </div>
    );
};

export default DiceRoll;
